    const[contraseña, setContraseña]=useState("");

    return(<>
    <h2>Registrarse</h2>
    <p><input type="text" placeholder="Usuario" onChange={(e)=>setUsuario(e.target.value)}/></p>
    <p><input type="password" placeholder="Contraseña" onChange={(e)=>setContraseña(e.target.value)}/></p>
    <p><input type="button" className="entrada" value="Confirmar"/></p>
    </>
    )
}
export default Registrarse;
